{
	"imports": "
import { IgcDataChartComponent } from 'igniteui-webcomponents-charts';
import { IgcCategoryStyle } from 'igniteui-webcomponents-charts';
import { IgcSeriesComponent } from 'igniteui-webcomponents-charts';
",
	"handler": "
    public categoryStyleTurnLowValuesRed(sender: any, args: IgcAssigningCategoryStyleEventArgs): void {
        var series = sender as IgcSeriesComponent;
        var items = args.getItems(args.startIndex, args.endIndex);
        for (var i = 0; i < items.length; i++) 
        {
            var item = items[i];
            var value = series.getItemValue(item, "valueMemberPath") as number;
            if (value < 60) {
                args.fill = "red";
            }
        }
    }
    "
}

{
	"imports": "
using Infragistics.Controls.Description;
using Infragistics.Controls.Layouts;
using Infragistics.Controls.Charts;
using System.Windows.Media;
",
	"handler": "
    //WPF: Infragistics.Controls.Charts.AssigningCategoryStyleEventHandler
    public void CategoryStyleTurnLowValuesRed(object sender, AssigningCategoryStyleEventArgs args)
    {
        var series = (Series)sender;
        var items = args.GetItems(args.StartIndex, args.EndIndex);
        for (var i = 0; i < items.Length; i++) 
        {
            var item = items[i];
            var value = (double)series.GetItemValue(item, "ValueMemberPath");
            if (value < 60) {
                args.Fill = new SolidColorBrush(Colors.Red);
            }
        }
    }
    "
}

